import React from "react";

function AllpostPage({ posts }) {
  return (
    <div>
      {posts.map((x, i) => (
        <div>
          <img url={x.image}></img>
          <div>{x.title}</div>
          <div>{x.location}</div>
        </div>
      ))}
    </div>
  );
}

export default AllpostPage;
